import React from 'react';
import SeriseCard from '../card/SeriseCard';

export default (props)=>{
	return(
		<div className="app-wrapper">
			<div className="row">
				<div className="col-lg-3 col-md-4">
					<SeriseCard/>
				</div>
				<div className="col">
					<h3>Serise Name</h3>
					<span>Rating</span>
				</div>
			</div>
		</div>
	)
}
